INSERT INTO Prot_Infos VALUES (178, 0, 1, 'Function', 'Transcription process is further dependent on VP30, an essential EBOV-specific transcription factor.', 12912982);
INSERT INTO Prot_Infos VALUES (44, 0, 2, 'Composition', 'SH protein is a membrane protein. Treatment of microsomes with TPCK-trypsin suggested that the SH protein is oriented in the membrane with its C-terminal facing the cytoplasm.', 8918542);
INSERT INTO Prot_Infos VALUES (178, 0, 2, 'Structure-Role/Function', 'The essential role of homo-oligomerization for the function of VP30 was further corroborated by the finding that mixed VP30 oligomers consisting of VP30 and transcriptionally inactive VP30 mutants were impaired in their ability to support EBOV transcription.', 12912982);
INSERT INTO Prot_Infos VALUES (185, 0, 1, 'Structuration', 'Marburg virus VP30 is also present as an oligomer.', 12912982);
INSERT INTO Prot_Infos VALUES (178, 0, 3, 'Structuration', 'Marburg virus VP30 is also present as an oligomer.', 12912982);
INSERT INTO Prot_Infos VALUES (178, 0, 4, 'Role', 'It has been shown that the protein is not only an activator of viral transcription but is also involved in the formation of the viral nucleocapsid. The switch between the two functions of VP30 is presumed to be modulated by phosphorylation of six serine residues in the N terminus of the molecule.', 12052831);
INSERT INTO Prot_Infos VALUES (178, 0, 5, 'Structure-Role/Function', 'Oligomerization is not needed for the interaction of VP30 with the EBOV nucleocapsid ( NB: nucleocapsid bindingdomain of VP30), oligomerization of VP30 is essential for the transactivating function and for the propagation of EBOV in cell culture.', 12912982);
INSERT INTO Prot_Infos VALUES (178, 0, 6, 'Activity', 'EBOV VP30 does not act as an elongation factor. Since mRNA synthesis was strongly dependent on the presence of VP30, it is assumed that VP30 is involved in an early step of transcription. VP30-regulated transcription is dependent on secondary structure formation of the NP gene start sequence. All filoviral transcription start signals are predicted to be involved in formation of stable stem-loop structures. The proper secondary structure formation ofthe NP gene start signal is a prerequisite for VP30-dependent transcription activation.and its secondary structure acts as an autonomous signal. Transcription reinitiation at internally located gene start signals with intact stem-loop structures is nota VP30-regulated process. Transcription activation at the first promoter-proximal gene start signal, however, is strongly regulatedby VP30. This regulation is dependent on a proper secondary structure formation of the transcription start site.', 12163572);
INSERT INTO Prot_Infos VALUES (178, 0, 7, 'Activity Note', 'Since the sequences downstream of the highly conserved transcription start signals are not conserved, the structure of the predicted stem-loops varies from gene to gene .', NULL);
