INSERT INTO Prot_Infos VALUES (391, 0, 1, 'Origine sequence', 'Additional ORF, p10 or X, encodes a polypeptide of 10 Kb present in BDV-infected cells. The synthesis starts within the same mRNA transcription unit as p24, but 49 nucleotides upstream, and it overlaps, in a different frame, with the 71 N-ter aa of p24.', NULL);
INSERT INTO Prot_Infos VALUES (243, 0, 1, 'Cleavage', 'GP-84 and GP-43 likely correspond to the full-length BVp56 gene and to its C terminus, respectively. Results suggested that GP-43 is generated by cleavage of GP-84 by a cellular protease.', 9060684);
INSERT INTO Prot_Infos VALUES (243, 0, 2, 'Localisation', 'Subcellular localization studies demonstrated that GP-84 accumulates in the ER, whereas GP-43 reaches the cell surface.', 9060684);
INSERT INTO Prot_Infos VALUES (243, 0, 3, 'Role/Function', 'Both BVp56 products were found to be associated with infectious virions, and antibodies to BVp56 had neutralizing activity. Findings suggest that BVp56 exhibits a novel form of processing for an animal NNS RNA virus surface glycoprotein, which might influence the assembly and budding of BDV.', 9060684);
INSERT INTO Prot_Infos VALUES (243, 0, 4, 'Composition-Role/Function', ' There is a stretch of five arginines located in amino acid positions 245 to 249 of BVp56. This sequence conforms to the minimal consensus sequence R(K/R)(K/R)R recognized by furin, a cellular calcium-dependent, subtilisin-like endoprotease which accumulates in the trans-Golgi network.', 9420287);
INSERT INTO Prot_Infos VALUES (242, 0, 1, 'Role', 'Lectin binding and endoglycosidase sensitivity assays indicate that gp18 is an unusual N-linked glycoprotein.', 7933072);
INSERT INTO Prot_Infos VALUES (240, 0, 2, 'Origine sequence', '(Fields) Two isoforms of BDV N protein p40 and p38 are found in BDV-infected cells. These two forms may be encoded by two different mRNA species, but differential usage of two in-frame initition codons present in the BDV p40 gene could also contribute to the production of BDV p40/38.', NULL);
