INSERT INTO Prot_Infos VALUES (215, 0, 2, 'Localisation', '(Fields) GNS is synthesized in approximately the same amount as G during cell infection, but it is not found in the mature virion. Intracellularly, it is localized in the endoplasmic reticulum/golgi complex, and it associated with amorphous structures in the cell surface but not with viruses in the budding process.', NULL);
