INSERT INTO Prot_Infos VALUES (174, 0, 1, 'Biochemical', 'The cellular E3 ubiquitin ligase Nedd4 regulates budding of VP40-induced virus-like particles (VLPs) through interaction with the PPxY motif. The WW domains of Nedd4 are essential for binding to the viral PPxY motif, and a small fragment of Nedd4 containing only WW domains significantly inhibited Ebola VLP budding in a dominant-negative manner', 12941909);
