INSERT INTO Prot_Infos VALUES (102, 0, 2, 'Activation', 'Cellular tubulin activate in vitro transcription with Sendai virus (SeV) particles. Tubulin dissociates viral matrix (M) protein, which acts as a negative regulator for transcription, from viral ribonucleoprotein (RNP) consisting of L, P, N proteins, and the genome RNA.', 14592411);
