INSERT INTO Prot_Infos VALUES (94, 0, 1, 'Structuration', 'There are two conserved regions of heptad repeat (HR1 and HR2) in the fusion protein. They also appear to show characteristic structure in the fusion core: the HR1/HR2 forms stable six-helix coiled-coil centered by HR1 and is surrounded by HR2 (trimer of HR1/HR2), which represents the post-fusion conformational structure. The HR1 and HR2 interact with each other and form stable six-helix coiled-coil bundle. F protein is believed to undergo series of conformational changes that expose the fusion peptide in the N-terminus of F1 and results in the fusion peptide embedding into the host cell, pullingthe cell/virus membranes into close proximity, and fusing into one single membrane. During this process,the highly conserved heptad repeat (HR) regions play animportant role. There are two major HR regions in the F protein, HR1 and HR2 (or called HR-A and HR-B insome literature), in paramyxovirus including MeV.', 12470664);
INSERT INTO Prot_Infos VALUES (94, 0, 2, 'Role', 'HR2 inhibition role in the fusion', NULL);
