INSERT INTO Prot_Infos VALUES (170, 0, 2, 'Activity', 'RSV protein, M2-1, is known to be important for transcriptionby the RSV polymerase, particularly on longer genes. M2-1 functions as an elongation factor, allowing the complete synthesis of RSV mRNAs(1) and as an anti-termination factor to permit transit through GE and intergenic regions which allows the RSV polymerase access to promoter-distal genes(2/3/4) - pmid: 8552680 , 10364337 , 9847319 , 9420254.', 8552680);
INSERT INTO Prot_Infos VALUES (170, 0, 3, 'Activity', 'Motif Zinc binding: The M2-1 protein contains a Cys(3)-His(1) motif (C-X(7)-C-X(5)-C-X(3)-H) near the amino terminus. This motif is conserved in all human, bovine, and ovine strains of RS ( respiratory syncytial )virus. A similar motif found in the mammalian transcription factor Nup475 has been shown to bind zinc. The M2-1 protein of human RS virus functions as a transcription factor which increases polymerase processivity, and it enhances readthrough of intergenic junctions during RS virus transcription, thereby acting as a transcription antiterminator.', 10846068);
