INSERT INTO Prot_Infos VALUES (506, 9, 9, 'Function', 'The zinc content of purified NS5A and the amino-terminal domain of NS5A was determined, and each of these proteins was found to coordinate one zinc atom per protein.', 15339921);
INSERT INTO Prot_Infos VALUES (506, 9, 10, 'Function/Mutation', ' Mutation of any of the four cysteine components of this motif reduced NS5A zinc coordination and led to a lethal phenotype for HCV RNA replication, whereas mutation of other potential metal coordination residues in the amino-terminal domain of NS5A, but outside the zinc-binding motif, had little effect on zinc binding and, aside from one exception, were tolerated for replication. Collectively, these results indicate that NS5A is a zinc metalloprotein and that zinc coordination is likely required for NS5A function in the hepatitis C replicase.', 15339921);
